// Thêm sự kiện click cho nút vCard
document.querySelectorAll('[id^="vcard-button-"]').forEach(btn => {
  btn.addEventListener('click', function () {
      const vCardData = `BEGIN:VCARD
VERSION:3.0
FN;CHARSET=UTF-8:NG CHEE WAH (Andy)
N;CHARSET=UTF-8:;NG CHEE WAH (Andy);;;
EMAIL;CHARSET=UTF-8;type=WORK,INTERNET:andyng@primecaptitalgroup.vn
PHOTO;ENCODING=b;TYPE=JPEG:
TEL;TYPE=CELL:0936693349
LABEL;CHARSET=UTF-8;TYPE=WORK:Company's address
ADR;CHARSET=UTF-8;TYPE=WORK:;;;3G7 Đ. 22\, Bình An\, Quận 2\, Hồ Chí Minh\, Vietnam\, Quận 2\, Hồ Chí Minh\, Việt Nam;;;
TITLE;CHARSET=UTF-8:COO Founder
ORG;CHARSET=UTF-8:F2Tech
URL;type=WORK;CHARSET=UTF-8:http://f2tech.asia/
REV:2024-08-30T08:29:33.523Z
END:VCARD
`;

    const blob = new Blob([vCardData], { type: 'text/vcard' });
    const url = window.URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.style.display = 'none';
    a.href = url;
    a.download = 'contact.vcf';
    document.body.appendChild(a);
    a.click();
    window.URL.revokeObjectURL(url);
    document.body.removeChild(a);
  });
});

// Thêm sự kiện click cho các nút dialog
document.querySelectorAll('[id^="dialog-button-"]').forEach(btn => {
  const dialogButtonId = btn.id.replace('dialog-button-', '');

  btn.addEventListener('click', function () {
    const dialogOverlay = document.getElementById(`dialog-${dialogButtonId}-overlay`);
    const dialogContent = document.getElementById(`dialog-${dialogButtonId}-content`);
    const dialogBox = document.getElementById(`dialog-${dialogButtonId}-box`);
    const dialogClose = document.getElementById(`dialog-${dialogButtonId}-close`);

    if (dialogOverlay && dialogContent && dialogBox) {
      dialogOverlay.classList.remove('hidden');
      dialogContent.classList.remove('hidden');
      dialogBox.classList.remove('hidden');
    }

    if (dialogOverlay) {
      dialogOverlay.addEventListener('click', () => {
        dialogOverlay.classList.add('hidden');
        dialogContent.classList.add('hidden');
        dialogBox.classList.add('hidden');
      });
    }

    if (dialogClose) {
      dialogClose.addEventListener('click', () => {
        dialogOverlay.classList.add('hidden');
        dialogContent.classList.add('hidden');
        dialogBox.classList.add('hidden');
      });
    }
  });
});
